import "./index.css";
import React, { useState } from "react";
import { Button, TextField } from "@mui/material";
import { createTheme, ThemeProvider } from "@mui/material/styles";

const theme = createTheme({
  status: {
    danger: "#e53e3e",
  },
  palette: {
    primary: {
      main: "#b9114b",
      darker: "#053e85",
    },
    neutral: {
      main: "#64748B",
      contrastText: "#fff",
    },
  },
});

function EsqueciSenha() {
  return (
    <div className="principalEsqueciSenha">
      <h3>Esqueceu sua senha?</h3> <br />
      <a>Informe seu email e aguarde!</a> <br />
      <a>Vamos enviar as instruções para recuperar sua senha</a> <br />
      <br />
      <br />
      <TextField label="E-mail"></TextField> <br />
      <Button variant="contained"> Recuperar Senha</Button>
    </div>
  );
}

export default EsqueciSenha;
